package spring.jc.web;

public class TestVO {
String name;
String id;

public TestVO() {
	// TODO Auto-generated constructor stub
}


public TestVO(String name, String id) {
	super();
	this.name = name;
	this.id = id;
}


public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}
public String getId() {
	return id;
}
public void setId(String id) {
	this.id = id;
}


}
